goal is to create a register with two inputs, load and in where the in bit will set the content of the register and the load bit will decide whether we read or write. here is the abstraction and implementation: // This file is part of www.nand2tetris.org
// and the book "The Elements of Computing Systems"
// by Nisan and Schocken, MIT Press.
// File name: projects/03/a/Bit.hdl /** * 1-bit register: * If load[t] == 1 then out[t+1] = in[t] * else out does not change (out[t+1] = out[t]) */ CHIP Bit { IN in, load; OUT out; PARTS: Mux(a=DFFOut, b=in, sel=load, out=MuxOut); DFF(in=MuxOut, out=out, out=DFFOut);
}

