// File name: projects/03/a/PC.hdl /** * A 16-bit counter with load and reset control bits. * if (reset[t] == 1) out[t+1] = 0 * else if (load[t] == 1) out[t+1] = in[t] * else if (inc[t] == 1) out[t+1] = out[t] + 1 (integer addition) * else out[t+1] = out[t] */ CHIP PC { IN in[16],load,inc,reset; OUT out[16]; PARTS: Mux16(a=incMuxOut, b=in, sel=load, out=loadMuxOut); Mux16(a=loadMuxOut, b=false, sel=reset, out=resetMuxOut); Register(in=resetMuxOut, load=true, out=regOut, out=out); Inc16(in=regOut, out=incOut); Mux16(a=regOut, b=incOut, sel=inc, out=incMuxOut);
}
